pragma solidity ^0.5.0;

contract Election {
    // Model a Candidate
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    // Store accounts that have voted
    mapping(address => bool) public voters;
    // Store Candidates
    // Fetch Candidate
    mapping(uint => Candidate) public candidates;
    // Store Candidates Count
    uint public candidatesCount;
    uint public votersCount;

    // voted event
    event votedEvent (
        uint indexed _candidateId
    );

    constructor () public {
        addCandidate("Candidate 1");
        addCandidate("Candidate 2");
        addCandidate("Candidate 3");
        addCandidate("Candidate 4");
        addCandidate("Candidate 5");
        addCandidate("Candidate 6");
        addCandidate("Candidate 7");
        addCandidate("Candidate 8");
        addCandidate("Candidate 9");
        addCandidate("Candidate 10");
        addCandidate("Candidate 11");
        addCandidate("Candidate 12");
        addCandidate("Candidate 13");
        addCandidate("Candidate 14");
        addCandidate("Candidate 15");
    }

    function addCandidate (string memory _name) public {
        candidatesCount ++;
        candidates[candidatesCount] = Candidate(candidatesCount, _name, 0);
    }

    function vote (uint _candidateId) public {
        // require that they haven't voted before
        require(!voters[msg.sender],"you have already voted");

        // require a valid candidate
        require(_candidateId > 0 && _candidateId <= candidatesCount,"candidate dowsn't exist");

        // record that voter has voted
        voters[msg.sender] = true;
        votersCount++;

        // update candidate vote Count
        candidates[_candidateId].voteCount ++;

        // trigger voted event
        emit votedEvent(_candidateId);
    }
}
